    salinity and other variables collected from Surface underway observations using
    Carbon dioxide (CO2) gas analyzer, Shower head chamber equilibrator for autonomous
    carbon dioxide (CO2) measurement and other instruments from HEALY in the Arctic
    Ocean, Beaufort Sea and others from 2013-08-06 to 2013-10-29 (NCEI Accession 0144346)",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-03-07T18:33:58.441655",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-surf71500",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0144346 includes Surface
    underway data collected from HEALY in the Arctic Ocean, Beaufort Sea, Bering Sea
    and Northwest Passage from 2013-08-06 to 2013-10-29. These data include BAROMETRIC
    PRESSURE, Partial pressure (or fugacity) of carbon dioxide - water, SALINITY and
    SEA SURFACE TEMPERATURE. The instruments used to collect these data include Carbon
    dioxide (CO2) gas analyzer and Shower head chamber equilibrator for autonomous carbon
    dioxide (CO2) measurement.nnThese data were collected by Taro Takahashi and Stew
    Sutherland of Columbia University; Lamont-Doherty Earth Observatory and Colm Sweeney
    of University of Colorado at Boulder; Cooperative Institute for Research In Environmental
    Sciences as part of the VOS_Healy_Lines_2013 data set. CDIAC associated the following
    cruise ID(s) with this data set: 32HQ20130806nnThe Global Volunteer Observing Ship
    (VOS) Program is coordinated by the UNESCO International Ocean Carbon Coordination
    Project (IOCCP). International groups from 14 countries have been outfitting research
    ships and commercial vessels with automated CO2 sampling equipment to analyze the
    carbon exchange between the ocean and atmosphere.",nt"license_title": null,nt"extras":
